import React from 'react';

function TrainingInformation() {
  const subjects = [
    {
      name: 'Back',
      imageSrc: 'back-image.jpg',
      info: [
        'Information 1 for Back',
        'Information 2 for Back',
        'Information 3 for Back',
      ],
    },
    {
      name: 'Chest',
      imageSrc: 'chest-image.jpg',
      info: [
        'Information 1 for Chest',
        'Information 2 for Chest',
        'Information 3 for Chest',
      ],
    },
    {
      name: 'Legs',
      imageSrc: 'legs-image.jpg',
      info: [
        'Information 1 for Legs',
        'Information 2 for Legs',
        'Information 3 for Legs',
      ],
    },
    {
      name: 'Hands',
      imageSrc: 'hands-image.jpg',
      info: [
        'Information 1 for Hands',
        'Information 2 for Hands',
        'Information 3 for Hands',
      ],
    },
    {
      name: 'Shoulders',
      imageSrc: 'shoulders-image.jpg',
      info: [
        'Information 1 for Shoulders',
        'Information 2 for Shoulders',
        'Information 3 for Shoulders',
      ],
    },
  ];


  return (
    <div>
    <h1>Subjects</h1>
    {subjects.map((subject, index) => (
      <div key={index}>
        <h2>{subject.name}</h2>
        <img src={subject.imageSrc} alt={subject.name} width="300" height="400" />

        <div>
          <table>
            <tbody>
              {subject.info.reduce((rows, info, index) => {
                if (index % 3 === 0) {
                  rows.push([]);
                }
                rows[rows.length - 1].push(
                  <td key={index} style={{ width: '33.33%' }}>
                    {info}
                  </td>
                );
                return rows;
              }, []).map((row, rowIndex) => (
                <tr key={rowIndex}>{row}</tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    ))}
  </div>
  );
}

export default TrainingInformation;
